  random(probs) {
    let roll = Math.random();
    let action = 0;
    for (;;) {
      roll -= probs[action];
      if (roll <= 0) {
        break;
      }
      action++;
    }
    return action;
  }

  max(probs) {
    let max = 0;
    let maxI = 0;
    for (let i = 0; i < probs.length; i++) {
      if (probs[i] > max) {
        maxI = i;
        max = probs[i];
      }
    }
    return maxI;
  }

